import React from 'react';
import Login from './components/Login';
import styled from 'styled-components';

const AppContainer = styled.div`
  display: flex;
  flex-direction: column;
  min-height: 100vh;
  background-color: #fff;
`;

function App() {
  return (
    <AppContainer>
      <Login />
    </AppContainer>
  );
}

export default App;
